import React from 'react'
import { Box } from 'grommet'
import {
  IconButton,
  Modal,
  ModalFooter,
  ModalHeader,
  useGlobalModalContext
} from '../../components'
import { File } from '../../icons'
import { FileView } from './file-view'
import { CaptionFormWithAttachment } from './caption-form-with-attachment'
import { b64ToBlobUrl } from './b64ToBlobUrl'

const Title = () => {
  return (
    <Box direction="row" gap="10px">
      <IconButton icon={<File color="#007bff" />} />
    </Box>
  )
}

//TODO delete after implementation attach content functionality
export const b64example = ``

export const AttachFileModal = () => {
  const { closeModal } = useGlobalModalContext()

  const contentUrl = b64ToBlobUrl(b64example, 'image/png')

  return (
    <Modal onClickOutside={closeModal} onEsc={closeModal} width="360px">
      <ModalHeader title={<Title />} onClose={closeModal} />
      <FileView onDelete={closeModal} contentUrl={contentUrl} />
      <ModalFooter>
        <CaptionFormWithAttachment />
      </ModalFooter>
    </Modal>
  )
}
